import React, {useState, useEffect} from 'react'

function App() {
  const [data, setData] = useState([{}])


  useEffect(() => {
    fetch('/recipes').then(
      response => response.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])
  return (
    <div>
      <h1>Hello World</h1>
    </div>
  )
}


export default App
